export default {
  data: function data() {
    return {
      direction: 'top',
      fab: false,
      fling: false,
      hover: false,
      tabs: null,
      top: false,
      right: true,
      bottom: true,
      left: false,
      transition: 'slide-y-reverse-transition'
    };
  },
  computed: {
    activeFab: function activeFab() {
      switch (this.tabs) {
        case 'one':
          return {
            'class': 'purple',
            icon: 'account_circle'
          };

        case 'two':
          return {
            'class': 'red',
            icon: 'edit'
          };

        case 'three':
          return {
            'class': 'green',
            icon: 'keyboard_arrow_up'
          };

        default:
          return {};
      }
    }
  },
  watch: {
    top: function top(val) {
      this.bottom = !val;
    },
    right: function right(val) {
      this.left = !val;
    },
    bottom: function bottom(val) {
      this.top = !val;
    },
    left: function left(val) {
      this.right = !val;
    }
  }
};
